import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import boy from './assets/Avatars/boy.png';
import "./components.css"
import man from './assets/Avatars/man.png';
import nurse from './assets/Avatars/nurse.png';
import assistant from './assets/Avatars/shop-assistant.png';
import singer from './assets/Avatars/singer.png';
import steward from './assets/Avatars/steward.png';

export default function Rightbar() {
  return (
    <div    className='rightbar'    >
    <List
      sx={{
        width: '100%',
        maxWidth: 360,
        bgcolor: 'background.paper',
      }}
    >
      <ListItem>
          <Avatar src={boy}/>
        <ListItemText primary="Ezzkalash" secondary="ezzo" />
      </ListItem>

      <ListItem>
        <ListItemText secondary="Suggestion for you " />
        <p id="see">See more</p>

      </ListItem>
      <ListItem>
          <Avatar src={nurse}/>
        <ListItemText primary="Ward" secondary="Ward Daragmah" />
        <p>Follow</p>

      </ListItem>      <ListItem>
          <Avatar src={man}/>
        <ListItemText primary="noor" secondary="NoorAdawi" />
        <p>Follow</p>

      </ListItem>
            <ListItem>
          <Avatar src={singer}/>
        <ListItemText primary="mahmoud" secondary="Mahmoud Kalash" />
        <p>Follow</p>

      </ListItem>
      <ListItem>
          <Avatar src={assistant}/>
        <ListItemText primary="ammar" secondary="Ammar Shtaya" />
        <p>Follow</p>

      </ListItem>            <ListItem>
          <Avatar src={steward}/>
        <ListItemText primary="mosab" secondary="Mosab Swafta" />
        <p>Follow</p>

      </ListItem>
    </List>
    </div>
  );
}
